site.headStyle:
div.hero {
  min-height: 95vh;
}

.text-shadow {
    text-shadow: 0 0 1.5px black;
}

.fancybox {
    cursor: pointer;
}

.open-jobs {
  font-family: 'Roboto';
  font-style: normal;
  font-weight: 400;
  font-size: 56px;
  line-height: 56px;
  /* identical to box height, or 100% */


  color: #000000;

  mix-blend-mode: normal;
}
.open-jobs-text {
  font-family: 'Mulish';
  font-style: normal;
  font-weight: 300;
  font-size: 18px;
  line-height: 30px;
  /* or 167% */

  text-align: center;

  color: #7D7987;

  mix-blend-mode: normal;
}
.job-card {
  box-shadow: 10px 40px 50px rgba(229, 233, 246, 0.4);
  border-radius: 20px;
}
.job-card-title {
  font-family: 'Roboto';
  font-style: normal;
  font-weight: 700;
  font-size: 24px;
  line-height: 150%;
  /* identical to box height, or 36px */


  /* gray/900 */

  color: #18181B;
}
.job-card-rate {
  font-family: 'Roboto';
  font-style: normal;
  font-weight: 400;
  font-size: 24px;
  line-height: 24px;
  /* identical to box height, or 100% */

  letter-spacing: -0.5px;

  color: #3F3F46;
}
.job-card-tags {
  font-family: 'Roboto';
  font-style: normal;
  font-weight: 400;
  font-size: 16px;
  line-height: 150%;
  /* identical to box height, or 24px */


  /* gray/700 */

  color: #3F3F46;
}
.job-card-skill-card {
  border-radius: 7px;
}
.job-card-skill-card-text {
  font-family: 'Roboto';
  font-style: normal;
  font-weight: 400;
  font-size: 14px;
  line-height: 22px;
  /* identical to box height, or 160% */


  color: #1F1F1F;
}

site.headScript:
$(document).ready(function() {
	$('.fancybox').each(function () {
	    var href = this.getAttribute('data-silex-href') || this.getAttribute('href');
	    if (this.getAttribute('data-silex-href')) {
    	    this.removeAttribute('data-silex-href');
    	    // for the fancybox script
    	    this.setAttribute('href', href);
    	    // prevent silex from opening link
    	    $(this).off('click');
	    }
	    // this is a galery
	    this.setAttribute('data-fancybox-group', 'group1');
	});
	// create the fancybox
	$('.fancybox').fancybox();
});
